(29, 'Makanan Sehat', 4, 1, 'makanan-sehat', 'post-images/seJLy9L7sY4sHSq4OnVPoc2Yebm8NMAixXcc6deL.jpg', 'Makanan SehatKesadaran masyarakat untuk mengonsumsi makanan sehat kini semakin besar. Pasalnya selai...', '<h1><strong>Makanan Sehat</strong></h1><div><strong><br>Kesadaran masyarakat untuk mengonsumsi makanan sehat kini semakin besar. Pasalnya selain menjadi sumber energi, konsumsi makanan sehat juga dapat menurunkan risiko terkena penyakit serius, mulai dari diabetes, hipertensi, penyakit jantung, obesitas, hingga kanker. &nbsp;<br></strong><br></div><div><br>Konsumsi makanan sehat setiap hari sangat direkomendasikan untuk mencukupi kebutuhan gizi harian. Hal ini sebenarnya tidak sulit untuk dilakukan karena pilihan <a href=\"https://www.alodokter.com/makanan-sehat-untuk-diet-yang-lezat-dan-bergizi\">makanan sehat</a> yang baik untuk dikonsumsi setiap hari ada banyak ragamnya, contohnya <a href=\"https://www.alodokter.com/mengenal-makanan-fungsional-dan-beragam-manfaatnya-bagi-tubuh\">kelompok makanan fungsional.</a><strong> </strong>Tak hanya itu, konsumsi makanan sehat dibarengi dengan olahraga rutin juga penting untuk mendukung <a href=\"https://www.alodokter.com/tips-diet-sukses-menurunkan-berat-badan\">diet sukses</a>.<br><strong><br>Beragam Pilihan Makanan Sehat</strong></div><div><br>Agar bisa berfungsi dengan baik, tubuh membutuhkan nutrisi dan energi yang diperoleh dari makanan. Di dalam tubuh, makanan yang dikonsumsi akan mengalami <a href=\"https://www.alodokter.com/seperti-apa-proses-pencernaan-dan-penyerapan-makanan-di-dalam-tubuh\">proses pencernaan dan penyerapan nutrisi</a>.<br><br></div><div><br>Beberapa pilihan makanan sehat yang baik untuk dikonsumsi antara lain adalah:<br><br></div><div><strong><br>1. Sayuran hijau</strong></div><div><a href=\"https://www.alodokter.com/ini-daftar-sayuran-hijau-yang-harus-anda-konsumsi\"><br>Sayuran hijau</a> menempati urutan pertama dalam jenis makanan sehat karena mengandung banyak nutrisi penting, seperti serat, vitamin A, vitamin C, vitamin K, magnesium, kalsium, zat besi, folat, dan kalium, yang sangat baik untuk kesehatan.<br><br></div><div><br>Selain itu, sayuran hijau juga kaya akan antioksidan yang dapat melindungi tubuh dari kerusakan akibat radikal bebas. Pilihan sayuran hijau juga beragam, mulai dari sawi hijau, <a href=\"https://www.alodokter.com/ini-manfaat-brokoli-hijau-untuk-anda\">brokoli</a>, kangkung, selada, hingga bayam. Sayuran hijau juga dapat diolah dengan berbagai macam cara, mulai dari direbus, ditumis, hingga dikukus.<br><br></div><div><br>Untuk mempertahankan warna sayuran hijau tetap menarik, coba masak sayuran hijau menggunakan air mineral. Kandungan mineral di dalamnya, seperti sodium bikarbonat dan magnesium hidroksida, dapat mempertahankan warna hijau alami daun.<br><br></div><div><strong><br>2. Buah-buahan</strong></div><div><br>Selain sayur, buah juga sangat penting dikonsumsi karena mengandung banyak vitamin. Beberapa buah yang populer karena kekayaan nutrisinya adalah:<br><br></div><ul><li><a href=\"https://www.alodokter.com/jarang-bertemu-dokter-berkat-manfaat-apel\">Apel</a> (serat, vitamin C, dan antioksidan)</li><li>Jeruk (vitamin C)</li><li><a href=\"https://www.alodokter.com/sehat-tiap-hari-berkat-manfaat-pisang\">Pisang</a> (kalium)</li><li><a href=\"https://www.alodokter.com/tidak-cuma-enak-manfaat-alpukat-juga-banyak\">Alpukat</a> (lemak sehat, kalium, dan vitamin C)</li><li>Beri-berian, seperti <a href=\"https://www.alodokter.com/manfaat-blueberry-untuk-kesehatan-ternyata-sangat-dahsyat\">blueberry</a> dan <a href=\"https://www.alodokter.com/manisnya-manfaat-strawberry-ternyata-ada-banyak\">strawberry</a> (rendah kalori namun kaya akan antioksidan dan serat)</li></ul><div><strong><br>3. Daging dan telur</strong></div><div><br>Daging merupakan salah satu makanan sehat karena kaya akan nutrisi, terlebih lagi daging sapi tanpa lemak. Daging jenis ini mengandung protein dan zat besi paling tinggi dibandingkan dengan daging jenis lainnya.<br><br></div><div><br>Di samping daging, telur juga termasuk ke dalam makanan sehat. Selain tinggi protein, telur juga mengandung nutrisi lengkap, mulai dari vitamin, mineral, <a href=\"https://www.alodokter.com/sadari-manfaat-lemak-tak-jenuh-tunggal-dari-sekarang\">lemak tak jenuh</a>, hingga zat antioksidan.<br><br></div><div><strong><br>4. Kacang-kacangan dan biji-bijian</strong></div><div><br>Makanan sehat yang sarat akan nutrisi berikutnya adalah kacang-kacangan dan biji-bijian. Contohnya adalah kacang tanah, kacang mete, kacang almond, <a href=\"https://www.alodokter.com/mengenal-chia-seed-biji-bijian-yang-kabarnya-punya-banyak-manfaat\"><em>chia seed</em></a><em>, </em>biji labu, dan biji wijen.<br><br></div><div><br>Kacang-kacangan dan biji-bijian tersebut tidak hanya mengandung protein dan serat yang tinggi, tetapi juga kaya akan vitamin dan mineral, seperti magnesium dan vitamin E.<br><br></div><div><strong><br>5. Ikan dan makanan laut lainnya</strong></div><div><a href=\"https://www.alodokter.com/kandungan-gizi-makanan-laut-yang-baik-untuk-kesehatan\"><br>Makanan laut</a> merupakan pilihan makanan sehat yang kaya akan <a href=\"https://www.alodokter.com/manfaat-omega-3-mitos-atau-fakta\">asam lemak omega-3</a> dan yodium. Penelitian menunjukkan bahwa orang yang sering <a href=\"https://www.alodokter.com/5-manfaat-ikan-laut-yang-sayang-dilewatkan\">makan ikan laut</a> cenderung lebih panjang umur dan memiliki risiko lebih rendah terhadap banyak penyakit, termasuk penyakit jantung.<br><br></div><div><strong><br>6. Susu</strong></div><div><br>Susu banyak mengandung vitamin, mineral, protein hewani berkualitas, dan lemak sehat. Selain itu, susu merupakan salah satu sumber kalsium terbaik. Untuk memproleh nutrisi yang terdapat pada susu, Anda dapat mengonsumsinya secara langsung atau mengonsumsi produk olahannya, seperti <a href=\"https://www.alodokter.com/manfaat-keju-yang-sayang-untuk-dilewatkan\">keju</a> dan <a href=\"https://www.alodokter.com/beberapa-manfaat-yogurt-yang-bisa-didapat\">yoghurt</a>.<br><br></div><div><strong><br>Kenali Makanan yang Perlu Dihindari</strong></div><div><br>Agar terhindar dari berbagai macam penyakit, konsumsi makanan sehat saja tidak cukup. Anda juga harus membatasi atau menghindari asupan yang tidak sehat seperti berikut ini:<br><br></div><div><strong><br>Minuman tinggi gula</strong></div><div><br>Minuman dengan kadar gula yang tinggi, seperti minuman bersoda, jus dalam kemasan, dan minuman berenergi sebaiknya dihindari atau dibatasi. Jika sering dikonsumsi dalam jumlah besar, jenis minuman ini dapat memicu terjadinya <a href=\"https://www.alodokter.com/tidak-tertutup-kemungkinan-Anda-mengalami-resistensi-insulin\">resistensi insulin</a> di tubuh. Kondisi ini dapat menyebabkan berbagai penyakit serius, termasuk <a href=\"https://www.alodokter.com/diabetes-tipe-2\">diabetes tipe 2</a> dan <a href=\"https://www.alodokter.com/penyakit-jantung\">penyakit jantung</a>.<br><br></div><div><strong><br>Makanan cepat saji</strong></div><div><br>Hindari pula <a href=\"https://www.alodokter.com/yang-didapatkan-dari-makanan-cepat-saji\">makanan cepat saji</a> atau junk food<em>, </em>seperti kentang goreng, ayam goreng, dan daging olahan. Makanan jenis ini tidak hanya mengandung kalori yang tinggi, tapi juga rendah nutrisi. Selain itu, makanan cepat saji juga dapat mendorong keinginan makan secara berlebih, sehingga bisa memicu kenaikan berat badan. Jika dikonsumsi berlebihan, makanan cepat saji juga bisa menyebabkan <a href=\"http://jika%20dikonsumsi%20berlebihan%2C%20makanan%20cepat%20saji%20juga%20bisa%20menyebabkan%20kolesterol%20tinggi./\">kolesterol tinggi</a>.<br><br></div><div><strong><br>Makanan ringan kemasan</strong></div><div><br>Sama seperti makanan cepat saji, kebanyakan makanan ringan kemasan yang dijual di pasaran, seperti permen, es krim, dan biskuit, juga tinggi kalori dan rendah nutrisi sehingga perlu dibatasi. Jadi, konsumsi sesekali saja, ya!<br><br></div><div><br>Konsumsi makanan sehat sangat berkontribusi dalam membangun tubuh yang sehat, bahkan lebih dari olahraga. Jadi, mulailah mengonsumsi makanan sehat dengan <a href=\"https://www.alodokter.com/memenuhi-gizi-seimbang-dengan-panduan-piring-makan\">gizi seimbang</a> demi menjaga dan meningkatkan kesehatan tubuh Anda.<br><br></div><div><br>Agar Anda tidak bosan, konsumsilah makanan sehat dengan jenis yang berbeda setiap harinya atau kombinasikan macam-macam makanan tersebut agar nutrisi yang didapat juga lebih beragam.<br><br></div><div><br>Di samping mengonsumsi makanan sehat, Anda juga harus memperbanyak <a href=\"https://www.alodokter.com/jangan-remehkan-manfaat-minum-air-putih\">konsumsi air putih</a>. Sediakan air mineral dari sumber terlindungi sebagai air minum Anda sehari-hari untuk memenuhi kebutuhan cairan sekaligus mineral.<br><br></div><div><br>Selain itu, usahakan untuk selalu menerapkan pola hidup sehat dengan beristirahat yang cukup dan rutin berolahraga. Jika perlu, berkonsultasilah <a href=\"https://www.alodokter.com/cari-dokter/ahli-gizi\">ke dokter</a> untuk mendapatkan saran mengenai makanan sehat dan pola hidup yang sesuai dengan kebutuhan tubuh Anda.<br><br></div><div><br><br></div>', NULL, '2022-02-17 23:55:01', '2022-02-17 23:55:01'),
(30, 'Ini Percobaan', 4, 1, 'ini-percobaan', NULL, 'fds', '<div>fds</div>', NULL, '2022-02-18 00:02:24', '2022-02-18 00:02:24'),
(31, 'Politic', 8, 1, 'politic', 'post-images/Lc4SdkvHBxAhSWDY9nAAY69Rszx0BL7gxBrYPyMU.jpg', 'Politics (from Greek: Πολιτικά, politiká, \'affairs of the cities\') is the method of rulership over a...', '<div><strong><br>Politics</strong> (from <a href=\"https://en.wikipedia.org/wiki/Greek_language\">Greek</a>: <em>Πολιτικά</em>, <em>politiká</em>, \'affairs of the cities\') is the method of <a href=\"https://en.wikipedia.org/wiki/Sovereignty\">rulership</a> over a <a href=\"https://en.wikipedia.org/wiki/National_Government\">national government</a>, <a href=\"https://en.wikipedia.org/wiki/State_government\">state government</a> and <a href=\"https://en.wikipedia.org/wiki/Local_government\">local government</a> in <a href=\"https://en.wikipedia.org/wiki/Social_group\">groups</a>, or other forms of <a href=\"https://en.wikipedia.org/wiki/Power_(social_and_political)\">ruling power relations</a> among individuals, such as the distribution of <a href=\"https://en.wikipedia.org/wiki/Resource\">resources</a> or <a href=\"https://en.wikipedia.org/wiki/Social_status\">status</a>. The branch of <a href=\"https://en.wikipedia.org/wiki/Social_science\">social science</a> that studies <a href=\"https://en.wikipedia.org/wiki/Sovereignty\">rulership</a>, <a href=\"https://en.wikipedia.org/wiki/Law\">law making</a> and <a href=\"https://en.wikipedia.org/wiki/Government\">government</a> is referred to as <a href=\"https://en.wikipedia.org/wiki/Political_science\">political science</a>.<br><br></div><div><br>It may be used positively in the context of a \"political solution\" which is compromising and nonviolent,<a href=\"https://en.wikipedia.org/wiki/Politics#cite_note-2\">[2]</a> or descriptively as \"the art or science of government\", but also often carries a negative connotation.<a href=\"https://en.wikipedia.org/wiki/Politics#cite_note-HagueHarrop2013-3\">[3]</a> For example, abolitionist <a href=\"https://en.wikipedia.org/wiki/Wendell_Phillips\">Wendell Phillips</a> declared that \"we do not play politics; <a href=\"https://en.wikipedia.org/wiki/Anti-Slavery_International\">anti-slavery</a> is no half-jest with us.\"<a href=\"https://en.wikipedia.org/wiki/Politics#cite_note-4\">[4]</a> The concept has been defined in various ways, and different approaches have fundamentally differing views on whether it should be used extensively or limitedly, empirically or normatively, and on whether conflict or co-operation is more essential to it.<br><br></div><div><br>A variety of methods are deployed in politics, which include promoting one\'s own political views among people, <a href=\"https://en.wikipedia.org/wiki/Negotiation\">negotiation</a> with other political subjects, making <a href=\"https://en.wikipedia.org/wiki/Law\">laws</a>, and exercising <a href=\"https://en.wikipedia.org/wiki/Force_(law)\">force</a>, including <a href=\"https://en.wikipedia.org/wiki/Warfare\">warfare</a> against adversaries.<a href=\"https://en.wikipedia.org/wiki/Politics#cite_note-Hammarlund1985-5\">[5]</a><a href=\"https://en.wikipedia.org/wiki/Politics#cite_note-Brady2017-6\">[6]</a><a href=\"https://en.wikipedia.org/wiki/Politics#cite_note-HawkesworthKogan2013-7\">[7]</a><a href=\"https://en.wikipedia.org/wiki/Politics#cite_note-Taylor2012-8\">[8]</a><a href=\"https://en.wikipedia.org/wiki/Politics#cite_note-9\">[9]</a> Politics is exercised on a wide range of social levels, from <a href=\"https://en.wikipedia.org/wiki/Clans\">clans</a> and <a href=\"https://en.wikipedia.org/wiki/Tribes\">tribes</a> of traditional societies, through modern <a href=\"https://en.wikipedia.org/wiki/Local_government\">local governments</a>, <a href=\"https://en.wikipedia.org/wiki/Company\">companies</a> and institutions up to <a href=\"https://en.wikipedia.org/wiki/Sovereign_state\">sovereign states</a>, to the <a href=\"https://en.wikipedia.org/wiki/International_politics\">international level</a>. In modern <a href=\"https://en.wikipedia.org/wiki/Nation_states\">nation states</a>, people often form <a href=\"https://en.wikipedia.org/wiki/Political_parties\">political parties</a> to represent their ideas. Members of a party often agree to take the same position on many issues and agree to support the same changes to law and the same leaders. An <a href=\"https://en.wikipedia.org/wiki/Election\">election</a> is usually a competition between different parties.<br><br></div><div><br>A <a href=\"https://en.wikipedia.org/wiki/Political_system\">political system</a> is a framework which defines acceptable political methods within a society. The <a href=\"https://en.wikipedia.org/wiki/History_of_political_thought\">history of political thought</a> can be traced back to early antiquity, with seminal works such as <a href=\"https://en.wikipedia.org/wiki/Plato\">Plato</a>\'s <a href=\"https://en.wikipedia.org/wiki/Republic_(Plato)\"><em>Republic</em></a> and <a href=\"https://en.wikipedia.org/wiki/Aristotle\">Aristotle</a>\'s <a href=\"https://en.wikipedia.org/wiki/Politics_(Aristotle)\"><em>Politics</em></a> in the West, and <a href=\"https://en.wikipedia.org/wiki/Confucius\">Confucius</a>\'s political manuscripts and <a href=\"https://en.wikipedia.org/wiki/Chanakya\">Chanakya</a>\'s <a href=\"https://en.wikipedia.org/wiki/Arthashastra\"><em>Arthashastra</em></a> in the East.<a href=\"https://en.wikipedia.org/wiki/Politics#cite_note-10\">[10]<br></a><br>Sumber :&nbsp;<a href=\"https://en.wikipedia.org/wiki/Politics\">Politics - Wikipedia</a></div>', NULL, '2022-02-18 00:08:25', '2022-02-18 00:08:25'),
(32, 'Web Programming', 1, 5, 'web-programming', 'post-images/M0dOYo8QbZcDF14Lpvqpl0oHDTL997miMYaj4D8c.png', 'What Does Web Programming Mean?Web programming refers to the writing, markup and coding involved in...', '<div>What Does Web Programming Mean?<br><br></div><div>Web programming refers to the writing, markup and coding involved in Web development, which includes Web content, Web client and server scripting and network security. The most common languages used for Web programming are XML, HTML, JavaScript, Perl 5 and PHP. Web programming is different from just programming, which requires interdisciplinary knowledge on the application area, client and server scripting, and database technology.<br><br></div><div>Techopedia Explains Web Programming<br><br></div><div>Web programming can be briefly categorized into client and server coding. The client side needs programming related to accessing data from users and providing information. It also needs to ensure there are enough plug ins to enrich user experience in a graphic user interface, including security measures.<br><br></div><ol><li>To improve user experience and related functionalities on the client side, JavaScript is usually used. It is an excellent client-side platform for designing and implementing Web applications.</li><li>HTML5 and CSS3 supports most of the client-side functionality provided by other application frameworks.</li></ol><div>The server side needs programming mostly related to data retrieval, security and performance. Some of the tools used here include ASP, Lotus Notes, PHP, Java and MySQL. There are certain tools/platforms that aid in both client- and server-side programming. Some examples of these are Opa and Tersus.<br><br></div>', NULL, '2022-02-18 15:31:01', '2022-02-18 15:31:01'),
